Sometimes, you need some setup code, or other things that would distract from your example, but are important to make the tests work. Consider an example block that looks like this: /// /// Some documentation.
/// # fn foo() {} // this function will be hidden
/// println!("Hello, World!"); It will render like this: /// Some documentation.
# fn foo() {}
println!("Hello, World!"); Yes, that's right: you can add lines that start with # , and they will be hidden from the output, but will be used when compiling your code. You can use this to your advantage. In this case, documentation comments need to apply to some kind of function, so if I want to show you just a documentation comment, I need to add a little function definition below it. At the same time, it's only there to satisfy the compiler, so hiding it makes the example more clear. You can use this technique to explain longer examples in detail, while still preserving the testability of your documentation. For example, imagine that we wanted to document this code: let x = 5;
let y = 6;
println!("{}", x + y); We might want the documentation to end up looking like this: First, we set x to five: let x = 5;
# let y = 6;
# println!("{}", x + y); Next, we set y to six: # let x = 5;
let y = 6;
# println!("{}", x + y); Finally, we print the sum of x and y: # let x = 5;
# let y = 6;
println!("{}", x + y); To keep each code block testable, we want the whole program in each block, but we don't want the reader to see every line every time. Here's what we put in our source code: First, we set `x` to five: ```
let x = 5;
# let y = 6;
# println!("{}", x + y);
``` Next, we set `y` to six: ```
# let x = 5;
let y = 6;
# println!("{}", x + y);
``` Finally, we print the sum of `x` and `y`: ```
# let x = 5;
# let y = 6;
println!("{}", x + y);
``` By repeating all parts of the example, you can ensure that your example still compiles, while only showing the parts that are relevant to that part of your explanation. The #-hiding of lines can be prevented by using two consecutive hashes ##. This only needs to be done with the first # which would've otherwise caused hiding. If we have a string literal like the following, which has a line that starts with a #: let s = "foo
## bar # baz"; We can document it by escaping the initial #: /// let s = "foo
/// ## bar # baz";

